import React from "react";
import Faq from "react-faq-component";

const data = {
    title: "FAQs",
    rows: [
        {
            title: "How much do you charge?",
            content: "We charge $40/hr (which is well-below the industry average). And remember: we only get paid if your score improves!",
        },
        {
            title: "What does a typical tutoring session look like?",
            content: ``
        },
        {
            title: "How can I contact you?",
            content: ``
        }
    ],
};

const styles = {
    bgColor: "rgba(52,52,52,alpha)",
    titleTextColor: "white",
    rowTitleColor: "rgba(255,255,255,1)",
    rowContentColor: "rgba(255,255,255,1)",
    arrowColor: "white",
};

const config = {
    animate: true,
    arrowIcon: "V",
    tabFocus: true
};

export default function App() {

    return (
        <div style={{maxWidth:800, display:"flex", width: "100%", justifyContent: "center", margin:"auto"}}>
            <br />
            <Faq
                data={data}
                styles={styles}
                config={config}
            />
        </div>
    );
}
